import React from "react";
import axios from "axios";
import { useHistory, useNavigate } from "react-router-dom";

const DashBar = () => {
  const history = useNavigate();

  const Logout = async () => {
    try {
      await axios.delete("http://localhost:5000/logout");
      history.push("/");
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <nav
      className="bg-gray-100 py-4"
      role="navigation"
      aria-label="main navigation"
    >
      <div className="container mx-auto">
        <div className="flex items-center justify-between">
          <a className="text-2xl" href="https://bulma.io">
            <img
              src="../Attachments/Image/Logo.jpg"
              height="100"
              alt="logo"
            />
          </a>

          <a
            href="/"
            role="button"
            className="lg:hidden block px-4 py-2 text-blue-600 hover:text-blue-800"
            aria-label="menu"
            aria-expanded="false"
            data-target="navbarBasicExample"
          >
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
          </a>
        </div>

        <div
          id="navbarBasicExample"
          className="lg:flex lg:items-center lg:w-auto hidden"
        >
          <div className="lg:flex lg:mr-auto">
            <a
              href="/"
              className="block mt-4 lg:inline-block lg:mt-0 text-blue-600 hover:text-blue-800 mr-4"
            >
              Beranda
            </a>
          </div>

          <div className="lg:flex lg:w-auto">
            <div className="mt-4 lg:mt-0">
              <button
                onClick={Logout}
                className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
              >
                Keluar akun
              </button>
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default DashBar;
